[{'id': '1160533', 'description': '1.	Вирішити питання щодо завершення ремонту (облаштування) твердого покриття під’їзних шляхів до КП «Хмельницький міський перинатальний центр»;
про прийняте рішення інформувати до 05.08.2019  
Підстава: ст.22. Закону України «Про забезпечення санітарного та епідемічного благополуччя населення», п.2.5 ДСанПіН «Гігієнічні вимоги до розміщення, облаштування, обладнання та експлуатації перинатальних центрів», затверджених наказом МОЗ України 26.01.2012 № 55.

2.	Вирішити питання щодо забезпечення умов приймання, видачі та прання білизни, м’якого інвентарю відповідно до вимог «Інструкції зі збору, сортування, транспортування, зберігання, дезінфекції та прання білизни у закладах охорони здоров’я»;
про прийняте рішення інформувати до 05.08.2019  
Підстава: ст.22. Закону України «Про забезпечення санітарного та епідемічного благополуччя населення», наказ МОЗ України від 30.04.2014 № 293 «Інструкція зі збору, сортування, транспортування, зберігання, дезінфекції та прання білизни у закладах охорони здоров’я».

3.	Вирішити питання щодо належного облаштування приміщення для тимчасового зберігання медичних відходів;
про прийняте рішення інформувати до 05.08.2019  
Підстава: ст.22. Закону України «Про забезпечення санітарного та епідемічного благополуччя населення», пункт 11 розділу V ДСанПіН «Щодо поводження з медичними відходами» затверджених наказом МОЗ України від 08.06.2015р. №235.

4.	Вирішити питання облаштування контейнерного майданчику відповідно до вимог п.2.7 ДСанПіН «утримання територій населених місць»;
про прийняте рішення інформувати до 05.08.2019  
Підстава: ст.22. Закону України «Про забезпечення санітарного та епідемічного благополуччя населення», п.2.7 ДСанПіН «утримання територій населених місць» затверджених наказом МОЗ України від 17.03.2011 № 145.
5.	Вирішити питання щодо ремонту приміщень ЦСВ з метою приведення внутрішнього опорядження приміщень відповідно до їх функціонального призначення;  
про прийняте рішення інформувати до 05.08.2019  
Підстава: ст.22. Закону України «Про забезпечення санітарного та епідемічного благополуччя населення», п.2 розділу V ДСанПіН «Дезінфекція, передстерилізаційне очищення та стерилізація медичних виробів в закладах охорони здоров’я» затверджених наказом МОЗ України від 11.08.2014 №552.

6.	Вирішити питання забезпечення закладу посудом із нержавіючої сталі для приготування та зберігання готових страв;
про прийняте рішення інформувати до 05.08.2019  
Підстава: ст.22. Закону України «Про забезпечення санітарного та епідемічного благополуччя населення», п.8.7 ДСанПіН «Гігієнічні вимоги до розміщення, облаштування, обладнання та експлуатації перинатальних центрів», затверджених наказом МОЗ України 26.01.2012 № 55.

7.	Забезпечити мийні відділення (на робочих місцях) інструкціями щодо правил миття посуду та інвентарю із зазначенням концентрацій та обсягів застосовуваних мийних і дезінфекційних засобів;
Підстава: ст.22. Закону України «Про забезпечення санітарного та епідемічного благополуччя населення», п.8.15 ДСанПіН «Гігієнічні вимоги до розміщення, облаштування, обладнання та експлуатації перинатальних центрів», затверджених наказом МОЗ України 26.01.2012 № 55.

8.	Вирішити питання щодо ремонту внутрішнього оздоблення харчоблоку закладу.
про прийняте рішення інформувати до 05.08.2019  
Підстава: ст.22. Закону України «Про забезпечення санітарного та епідемічного благополуччя населення», розділу ІV ДСанПіН «Гігієнічні вимоги до розміщення, облаштування, обладнання та експлуатації перинатальних центрів», затверджених наказом МОЗ України 26.01.2012 № 55.', 'documents': [{'document': 'Про забезпечення санітарного та епідемічного благополуччя населення', 'document_part': 'ст.22'}, {'document': 'Про затвердження Державних санітарних норм і правил «Дезінфекція, передстерилізаційне очищення та стерилізація медичних виробів в закладах охорони здоров’я', 'document_part': 'п.5 Р1, пп.2,3'}, {'document': 'Про затвердження Державних санітарних норм і правил «Дезінфекція, передстерилізаційне очищення та стерилізація медичних виробів в закладах охорони здоров’я', 'document_part': 'п.5, Р5'}, {'document': 'Про затвердження Державних санітарних норм та правил утримання територій населених місць', 'document_part': 'п.2,7'}]}]

